import React, { useContext } from "react";
import { Link } from "react-router-dom";
import { ShoppingCart, User } from "phosphor-react";
import "../hoja-de-estilos/navbar.css";
import { ShopContext } from "../context/shop-context";


export const Navbar = () => {
    const context = useContext(ShopContext);
    console.log(context.logged);
    return (
        <div className="navbar">
        { !context.admin ? 
            !context.logged ?
                <div className="links"> 
                    <Link to="/"> TiendaVirtual </Link> 
                    <Link to="/login">
                        <User size={32}/>
                    </Link>
                </div>
                :
                <div className="links">
                    <h2>Bienvenido {context.nombreUser} </h2>
                    <Link to="/shop"> Seguir Comprando </Link>
                    <Link to="/cart"> Pagar
                        <ShoppingCart size={32} />
                    </Link>
                </div>
            :
            <div className="links">
                    <Link to="/editInventory"> Editar inventario </Link>
                    <Link to="/editAdmin"> Administrar usuarios </Link>
            </div>
        }
        </div>
    )
};
